import React from "react";

export const Contact = (props) => {
  return (
    <div>
      <div id="contact">
        <div className="container text-left text-lg-start text-muted">


          <div className="text-center p-4" style={{ backgroundColor: 'rgba(0, 0, 0, 0.05)' }}>
            &copy; 2023 Design by Hajar Ismail
          </div>
        </div>
      </div>
    </div>
  );
};
